CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost`  VIEW `port_empdept` AS select `port_emp`.`No` AS `FK_Emp`,`port_emp`.`FK_Dept` AS `FK_Dept` from `port_emp` ;

-- ----------------------------
-- View structure for port_empstation
