DROP VIEW IF EXISTS `port_inc`;
CREATE VIEW `port_inc` AS SELECT `p_un_group`.`GROUP_ID` AS `No`,`p_un_group`.`GROUP_CH_NAME`   AS `Name`,`p_un_group`.`PARENT_GROUP_ID` AS `ParentNo` FROM `p_un_group` ;

