INSERT INTO `p_fm_dynamicpage` VALUES ('1', '23', null, 'API管理列表', null, '1003', '0', null, null, null, null, null, '[{&quot;id&quot;:&quot;28e59625-77ac-23fa-a4da-6c647fd8f994&quot;,&quot;name&quot;:&quot;p_fm_api&quot;,&quot;isSingle&quot;:&quot;1&quot;,&quot;isPage&quot;:&quot;1&quot;,&quot;limitCount&quot;:&quot;20&quot;,&quot;description&quot;:&quot;&quot;,&quot;sqlScript&quot;:&quot;var name=request.getParameter(\\&quot;name\\&quot;);\\r\\nvar desc=request.getParameter(\\&quot;desc\\&quot;);\\r\\nvar id=request.getParameter(\\&quot;id\\&quot;);\\r\\nvar where =\\&quot;\\&quot;;\\r\\nif(name!=null &amp;&amp; name!=\\&quot;\\&quot;){\\r\\nwhere += \\&quot; and a.API_NAME LIKE \'%\\&quot;+name+\\&quot;%\'\\&quot;;\\r\\n}\\r\\nif(desc!=null &amp;&amp; desc!=\\&quot;\\&quot;){\\r\\nwhere += \\&quot; and a.API_DESC LIKE \'%\\&quot;+desc+\\&quot;%\'\\&quot;;\\r\\n}\\r\\n\\&quot;SELECT a.API_ID AS IDS, a.API_SQL,a.API_DESC,a.API_METHOD,case a.API_IS_LOGIN when \'1\' then \'需登录\' else \'不需登录\' end API_IS_LOGIN ,case a.API_STATE when \'0\' then \'禁用\' else \'启用\' end API_STATE,a.API_NAME,a.API_ID as ID,a.API_TABLE,case a.API_TYPE when \'0\' then \'forbidden\' when \'1\' then \'add\' when \'2\' then \'update\' when \'3\' then \'get\' when \'4\' then \'delete\' when \'5\' then \'excute\' when \'6\' then \'query\' when \'7\' then \'page\' when \'8\' then \'executeScript\' end API_TYPE FROM  p_fm_api a where 1=1 \\&quot; +where +\\&quot; order by a.API_CREATETIME desc \\&quot;;\\r\\n&quot;,&quot;deleteSql&quot;:&quot;&quot;,&quot;modelCode&quot;:&quot;p_fm_api&quot;,&quot;modelItemCodes&quot;:&quot;API_SQL,API_METHOD,API_TYPE,API_IS_LOGIN,API_ID,API_STATE,API_TABLE,API_DESC,API_NAME&quot;}]', '0', null, '$(&quot;.table tbody tr&quot;).each(function(i,e){\r\n	var id=$(this).children(&quot;td&quot;).eq(0).find(&quot;input&quot;).val();\r\n	var seq=$(this).children(&quot;td&quot;).eq(2)\r\n	seq.html(&quot;&lt;a href=\'&quot;+baseUrl+&quot;document/view.do?dynamicPageId=2&amp;id=&quot;+id+&quot;\'&gt;&quot;+seq.text()+&quot;&lt;/a&gt;&quot;)\r\n})', '2015-03-26 17:02:10', '2017-12-18 15:31:20', null, null, '<#assign path = request.getContextPath()>\r\n<#assign basePath = request.getScheme()+\"://\"+request.getServerName()+\":\"+request.getServerPort()+path+\"/\">\r\n	<#if p_fm_api_list?? && p_fm_api_list?size gt 0>\r\n             <#assign p_fm_api = p_fm_api_list[0]!\'\'>\r\n        </#if>\r\n<!DOCTYPE html>\r\n<html>\r\n<head lang=\"en\">\r\n    <meta charset=\"UTF-8\">\r\n    <meta content=\"width=device-width, initial-scale=1, maximum-scale=1, user-scalable=no\" name=\"viewport\">\r\n    <meta http-equiv=\"X-UA-Compatible\" content=\"IE=edge,chrome=1\" />\r\n    <link rel=\"stylesheet\" href=\"${basePath}template/AdminLTE/css/bootstrap.min.css\">\r\n    <link rel=\"stylesheet\" href=\"${basePath}template/AdminLTE/css/bootstrap-table.css\">\r\n    <link rel=\"stylesheet\" href=\"${basePath}template/AdminLTE/css/select2/select2.css\">\r\n    <link rel=\"stylesheet\" href=\"${basePath}template/AdminLTE/css/bootstrap-datetimepicker.min.css\">\r\n    <link rel=\"stylesheet\" href=\"${basePath}template/AdminLTE/css/AdminLTE.css\">  \r\n    <link rel=\"stylesheet\" href=\"${basePath}template/AdminLTE/css/ionicons.min.css\">\r\n    <link rel=\"stylesheet\" href=\"${basePath}template/AdminLTE/css/main.css\">\r\n    <script>\r\n		var basePath = \'${basePath!\'\'}\';\r\n		var cssFile={},scriptFile={};\r\n		//引入组件样式表\r\n		for(var e in cssFile){document.write(\'<link rel=\"stylesheet\" href=\"\'+e+\'\">\')}\r\n		cssFile=null;\r\n	</script>\r\n</head>\r\n<body>\r\n	<!-- Main content -->\r\n  <section class=\"content\">	\r\n		<div class=\"opeBtnGrop\">\r\n		<button data-valid=\"flase\" id=\'7dcba478-7377-4fbe-adf5-f59c0b00bb3e\' title=\"\"\r\n				class=\" btn   btn-primary\"\r\n					<#if (pageActStatus[\'7dcba478-7377-4fbe-adf5-f59c0b00bb3e\'][\'backId\'])??>\r\n						backId=\"${pageActStatus[\'7dcba478-7377-4fbe-adf5-f59c0b00bb3e\'][\'backId\']!\'\