col-md-8\",\r\n					height:\"40em\"\r\n				}).showModal();\r\n			}\r\n		})\r\n		//重复文件处理\r\n		$file.on(\"filebatchselected\", function(event, files) {\r\n			var fileLen = $(\".file-input .file-live-thumbs > .file-preview-frame\").length;\r\n			for(var i=0;i<fileLen;i++){\r\n				if(i!=fileLen-1){\r\n					var title = $(\".file-input .file-live-thumbs >  .file-preview-frame\").eq(i).find(\".file-footer-caption\").attr(\"title\");\r\n					if(files[files.length-1].name==title && title!=undefined){\r\n						files.pop();\r\n						$(\".file-input .file-live-thumbs >  .file-preview-frame\").eq(fileLen-1).next().remove();\r\n						$(\".file-input .file-live-thumbs >  .file-preview-frame\").eq(fileLen-1).remove();\r\n						break;\r\n					}\r\n				}\r\n			}\r\n		});\r\n		$file.on(\'fileerror\', function(event, data, msg) {\r\n			onError(event, data, msg);\r\n		});\r\n		$file.on(\"fileuploaded\", function (event, data, previewId, index) {\r\n             onSuccess(data,previewId);\r\n        });\r\n		//成功处理\r\n	   function onSuccess(data,previewId){\r\n		   var result=data.response;\r\n		   if(result.status==0){\r\n		       	 var arr = $orgfile.val().split(\";\");\r\n	             arr.push(result.data);\r\n	             var val=arr.join(\";\");\r\n	             //清除第一个多余的分号\r\n	             if(val.indexOf(\";\")==0){\r\n	             	val=val.substring(1);\r\n	             }\r\n	             $orgfile.val(val);\r\n	             $(\"#\"+previewId+\"\").attr(\"valNum\",result.data);\r\n		   }else{\r\n		      	Comm.alert(result.message);\r\n		   }\r\n	   }\r\n	   //出错处理\r\n	   function onError(event, data, msg){\r\n		   Comm.alert(msg);\r\n	   }\r\n	   \r\n	   //移除value\r\n	   function removeVal(thisValNum){\r\n			var val=$orgfile.val();\r\n			var idArr=val.split(\";\");\r\n			for(var i=0; i<idArr.length; i++) {\r\n			    if(idArr[i] == thisValNum) {\r\n			      idArr.splice(i, 1);\r\n			      break;\r\n			    }\r\n			}\r\n			$orgfile.val(idArr.join(\";\"));\r\n		}\r\n	})();\r\n\r\n\r\n\r\n\r\n(function(){\r\n		var that=$(\'#81394fe1-b88c-4032-a61a-e71fe2b8932c\');\r\n			\r\n})();\r\n\r\n	(function(){\r\n        var $select=$(\'#00dc3153-cafc-4eab-8317-64dd086639a2\');\r\n			$select.select2({\r\n				 width:\"100%\",\r\n				 placeholder:\'请选择\',\r\n				 allowClear:!0,\r\n				 language:\'zh-CN\'\r\n			});\r\n 		var val=$select.attr(\"value\");\r\n		var arr=[];\r\n		if($.trim(val).length>0){\r\n			var arr1=val.split(\";\");\r\n			for(var i=0;i<arr1.length;i++){\r\n				if(arr1[i].length>0){\r\n					arr.push(arr1[i]);\r\n				}\r\n			}\r\n        }\r\n		debugger;\r\n		if(arr.length>0){\r\n			$select.val(arr).trigger(\"change\");\r\n		}else{\r\n			 $select.val([]).trigger(\"change\");\r\n		}\r\n\r\n			$select.on(\"change\",function(){\r\n				\r\n			});\r\n	})();\r\n		\r\n		\r\n			\r\n			\r\n	$(\"#8186675f-43b4-45a1-965c-e46f5c6a83b1\").click(function(){\r\n			if(!Comm.validForm())\r\n				return;\r\n				var actId = $(this).attr(\"id\");\r\n$(\"#actId\").val(actId);\r\n	$.ajax({\r\n	   type: \"POST\",\r\n	   url: basePath + \"document/excuteOnly.do\",\r\n	   data:$(\"#groupForm\").serialize(),\r\n	   async : false,\r\n	   success: function(data){\r\n			if(data==1){\r\n				Comm.alert(\"保存成功\");\r\n				location.href= basePath + \"document/view.do?dynamicPageId=15\";\r\n			}\r\n			else{\r\n				Comm.alert(data);\r\n			}\r\n	   }\r\n	});\r\n	});\r\n	$(\"#c6490277-e7e5-4c98-801a-aaf5d52a3164\").click(function(){\r\n				actBackRun(\"c6490277-e7e5-4c98-801a-aaf5d52a3164\",\"15\");\r\n	});\r\n			\r\n	</script>\r\n</body>\r\n</html>', '2', '110', null, null, null, null, null, null, '1', '9999', '9999', '9999', '0', '0', null, '0', null, '0', null);
