\n        			$(\"input[value=\'\"+$($.trim(e[\"0\"])).attr(\"value\")+\"\']\").removeAttr(\"name\");\r\n        		 })\r\n				 count = $(\"input[name=\'_selects\']\").length;\r\n             },\r\n			 onSort:function(name, order){\r\n				 $(\"#allowOrderBy\").val(\"1\");\r\n				 var orderBy =$(\"#orderBy\").val();\r\n				 console.log(orderBy,name)\r\n				 if(orderBy.indexOf(name)!=-1&&orderBy.indexOf(\"desc\")!=-1){\r\n					 $(\"#orderBy\").val(name+\" asc\");\r\n				 }else{\r\n					 $(\"#orderBy\").val(name+\" desc\");\r\n				 }\r\n        		$(\"#groupForm\").submit();\r\n			 }\r\n         });							\r\n		\r\n	$(\"#931b0578-396f-4f70-a79e-3bed6b8e19f3\").click(function(){\r\n				actNewRun(\"931b0578-396f-4f70-a79e-3bed6b8e19f3\",\"5\");\r\n	});\r\n	$(\"#65f86c59-c80b-40e8-8b40-ddd7695b4570\").click(function(){\r\n				if(count!=1){	\r\n	alert(\"请选择一项进行操作\");\r\n	return false;\r\n}\r\nvar id = $(\"input[name=\'_selects\']\").val();\r\nlocation.href = basePath + \"document/view.do?dynamicPageId=5&id=\" + id;\r\n	});\r\n	$(\"#4cc5ece5-29de-4c01-8166-514e311e3704\").click(function(){\r\n				if(count==0){\r\n	alert(\"请至少选择一项进行操作\");\r\n	return false;\r\n}\r\nif(!confirm(\"是否确认删除?\")){\r\n	return false;\r\n}\r\nvar actId = $(this).attr(\"id\");\r\n$(\"#actId\").val(actId);	\r\n$.ajax({\r\n   type: \"POST\",\r\n   url: basePath + \"document/excuteOnly.do\",\r\n   data:$(\"#groupForm\").serialize(),\r\n   async : false,\r\n   success: function(data){\r\n		if(data==1){\r\n			alert(\"删除成功\");\r\n			location.href = basePath + \"document/view.do?dynamicPageId=4\";\r\n		}\r\n		else{\r\n			alert(data);\r\n		}\r\n   }\r\n});\r\n	});\r\n        \r\n		});\r\n	</script>\r\n</body>\r\n</html>', '1', '110', null, null, null, null, null, null, '1', '9999', '9999', '9999', '0', '0', null, '0', null, '0', '1');
